);

  wire [ 7:0] _bitseqLooper_playing;
  reg  [31:0] regControl;
  reg  [ 7:0] regArmMask;
  reg  [ 7:0] regStartCh;
  reg  [ 7:0] regStopCh;
  reg  [31:0] regWrControl;
  reg  [ 7:0] regWrAddr;
