          _raddr_T == 32'h18
            ? {24'h0, regChannelEnable}
            : _raddr_T == 32'h14
                ? {24'h0, _pwmEngine_pwm_out}
                : _raddr_T == 32'h10
                    ? {31'h0, regConfigSet}
                    : _raddr_T == 32'hC
                        ? regLowCount
                        : _raddr_T == 32'h8
                            ? regHighCount
                            : _raddr_T == 32'h4
                                ? {29'h0, regChannelSel}
                                : _raddr_T == 32'h0
                                    ? {23'h0, regChannelEnable, regPwmEnable}
                                    : 32'h0;
      axi_rvalid <= _GEN_6 | ~(axi_rvalid & S_AXI_RREADY) & axi_rvalid;
    end
